import React, { useState, useEffect } from "react";

interface UserPanelProps {
  userToken: number | null;
}

interface UserData {
  id: number;
  name: string;
  email: string;
  dateOfBirth: string;
  password: string;
}

export default function UserPanel(props: UserPanelProps) {
  const [userData, setUserData] = useState<UserData | null>(null);

  async function getUserData() {
    console.log("tutaj", props.userToken);
    try {
      const response = await fetch("http://127.0.0.1:5500/userPanel", {
        method: "POST",
        body: JSON.stringify({ token: props.userToken }),
        headers: {
          "Content-type": "application/json",
        },
      });
      const data = await response.json();
      setUserData(data);
    } catch (error) {
      console.log(error);
    }
  }
  useEffect(() => {
